import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

const routes: Routes = [
  {
    // authenticated routes
    path: '',
    component: DefaultComponent,
    children: [
      {
        path: '',
        redirectTo: 'dashboard',
        pathMatch: 'full',
        data: { breadcrumb: 'Dashboard' },
      },
      {
        path: 'dashboard',
        component: DashboardComponent,
        canActivate: [AuthGuard],
        data: { breadcrumb: 'Dashboard' },
      },
      {
        path: 'new-reservation',
        component: NewReservationComponent,
        canActivate: [AuthGuard],
        data: { breadcrumb: 'New Reservation' },
      },
      { path: 'companies/details/:id', component: CompanyDetailsComponent },
    ],
  },
  // public routes
  { path: 'login', component: LoginComponent, canActivate: [InitialGuard] },
  { path: 'sign-up', component: SignUpComponent, canActivate: [InitialGuard] },
  {
    path: 'verify-email',
    component: VerifyEmailComponent,
    canActivate: [InitialGuard],
  },
  {
    path: 'complete-registration',
    component: SignUpExtraInfoComponent,
    canActivate: [CompleteRegistrationGuard],
  },
  { path: '**', redirectTo: '' },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule],
})
export class AppRoutingModule {}
